import React from "react";
import {Button, Container} from "semantic-ui-react";
import "./style.css";

function Error(props) {
  return (
    <Container className='Error-container'>
      <p>{props.message}</p>
      <Button onClick={props.getBack}>Retour</Button>
    </Container>
  );
}

export default Error;
